import{_ as e,n as t,q as a,t as o}from"./chunks/theme-components.DDZ15eKn.js";import"./chunks/search-index.B-gvvmFQ.js";const r=JSON.parse('{"title":"Vue3.5","description":"","frontmatter":{},"headers":[],"relativePath":"src/note/Vue3.5.md","filePath":"src/note/Vue3.5.md","lastUpdated":1743124685000}');const c=e({name:"src/note/Vue3.5.md"},[["render",function(e,r,c,n,p,s){return a(),t("div",null,r[0]||(r[0]=[o('<h1 id="vue3-5" tabindex="-1">Vue3.5 <a class="header-anchor" href="#vue3-5" aria-label="Permalink to &quot;Vue3.5&quot;">​</a></h1><h2 id="_1、概述" tabindex="-1">1、概述 <a class="header-anchor" href="#_1、概述" aria-label="Permalink to &quot;1、概述&quot;">​</a></h2><p>就在2024-09-03号,vue推出了官方最新的3.5版本，以下是官方给我们的整个日志</p><blockquote><p>3.5.1 (2024-09-04)</p></blockquote><blockquote><p>Bug Fixes</p><p><code>build:</code> improve built-in components treeshakability (4eee630)</p><p>reactivity: handle non-array arguments in reactive concat method (#11794) (475977a), closes #11792</p><p>Transition: avoid applying transition hooks on comment vnode (#11788) (51912f8), closes #11782</p><p>types: avoid using intersection type in Readonly&lt;...&gt; to fix JSDoc emit (#11799) (7518bc1)</p><p><code>useTemplateRef:</code> fix readonly warning when useTemplateRef has same variable name as template ref (bc63df0), closes #11795 #11802 #11804</p></blockquote><blockquote><p>3.5.0 (2024-09-03)</p></blockquote><blockquote><p>Aggregated Features List for 3.5 (alpha to stable) Reactivity reactivity: Refactor reactivity system to use version counting and doubly-linked list tracking (#10397) (05eb4e0)</p><p>reactivity: Optimize array tracking (#9511) (70196a4)</p><p>compiler-sfc: enable reactive props destructure by default (d2dac0e)</p><p>reactivity: onEffectCleanup API (2cc5615), closes #10173</p><p>reactivity: add failSilently argument for onScopeDispose (9a936aa)</p><p>reactivity/watch: base watch, getCurrentWatcher, and onWatcherCleanup (#9927) (205e5b5)</p><p>reactivity/watch: add pause/resume for ReactiveEffect, EffectScope, and WatchHandle (#9651) (267093c)</p><p>watch: support passing number to deep option to control the watch depth (#9572) (22f7d96)</p><p>types: export MultiWatchSources type (#9563) (998dca5)</p><p>types: allow computed getter and setter types to be unrelated (#11472) (a01675e), closes #7271</p></blockquote><blockquote><p>vue官方的更新日志在这里： <a href="https://github.com/vuejs/core/blob/main/CHANGELOG.md" target="_blank" rel="noreferrer">https://github.com/vuejs/core/blob/main/CHANGELOG.md</a></p></blockquote><blockquote><p>Vue官方给我们的更新描述 <a href="https://cn.vuejs.org/about/releases.html" target="_blank" rel="noreferrer">https://cn.vuejs.org/about/releases.html</a></p></blockquote><p>💡 Vue3.5 版本号名称 <code>天元突破红莲螺岩</code></p><blockquote><p>关于这个版本号的名称： 07年二次元动漫,（Tengen Toppa Gurren Lagann）是一部日本的动画系列，由Gainax制作。故事设定在一个被地下封闭的世界，讲述了主角西蒙和他的伙伴们通过驾驶强大的机器人（Gurren Lagann）打破束缚，挑战天上霸主的冒险经历。作品有独特的风格、激动人心的剧情和丰富的动作场面</p></blockquote>',11)]))}]]);export{r as __pageData,c as default};
